import React, {Component} from 'react';
import {Navbar, Nav, Container, Modal, Form, Button, FormControl } from "react-bootstrap";
import CarouselBox from '../Components/CarouselBox.js';
import BreadCrumps from '../Components/BreadCrumps.js'
import Image from '../Images/muka4.jpeg'

export default function Main() {
  return(
    <>
        <BreadCrumps text = {'Главная'}/>
        <Container fluid className = {'p-0'}>
            <CarouselBox />
        </Container>
        <Container fluid>
        <div className = {'hello'}>
            <div className ={'helloText'}>

            </div>
            <div className = {'helloImage'}>
            <img
            className={'d-block m-0 p-0'}
            src={Image}
            alt={'Img'}/>
            </div>
        </div>
        </Container>
    </>
  );
}
